import React, { useState } from 'react';
import About from './About';
import Books from './Books';
import Footer from './Footer';
import Navbar from './Navbar';

const Home = () => {
      const [book,setBook] = useState(true);

      return(
            <>
                  <div style={{height:'72px'}}/>
                  <Navbar book={book}/>
                  {book? (<Books/>) : (<>
                  <div id='About'/>
                  <About/>
                  <div id='Contact'/>
                  <Footer/></>)}
            </>
      )
}

export default Home ;
